import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import Header from './composants/header';
import Accueil from './Ecrans/Accueil';


const TabNavigator = () => (
  <Tab.Navigator screenOptions={({ route }) => ({
    tabBarShowLabel: false,
  })}>
    <Tab.Screen name="Accueil" component={Accueil}
      options={{
        headerShown: false,
        tabBarLabel: 'Accueil',
        tabBarIcon: ({ color, size }) => (
          <IconIonicons name="home" color={'black'} size={28} />
        )
      }}
    />
    <Tab.Screen name="stackFilm" component={StackNavigator}
      options={{
        headerShown: false,
        tabBarLabel: 'Films',
        tabBarIcon: ({ color, size }) => (
          <IconFontisto name="film" color={'black'} size={28} />
        )
      }}
    />
    <Tab.Screen name="Évaluation" component={EvaluationFilm}
      options={{
        headerShown: false,
        tabBarLabel: 'Évaluation',
        tabBarIcon: ({ color, size }) => (
          <IconFontAwesome name="star" color={'black'} size={28} />
        )
      }}
    />
  </Tab.Navigator>
)


export default function App() {
  return (
    <View style={styles.container}>
      <Header />
      <Text>Open up App.js to start working on your app!</Text>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
